<div class="entities" style="line-height: 2.5; direction: ltr">Genetic markers in the EET metabolic pathway are associated with outcomes in patients with aneurysmal subarachnoid hemorrhage . Preclinical studies show that epoxyeicosatrienoic acids ( EETs ) regulate cerebrovascular tone and protect against cerebral ischemia . We investigated the relationship between polymorphic genes involved in EET biosynthesis / metabolism , cytochrome P450 ( CYP ) eicosanoid levels , and outcomes in 363 patients with aneurysmal subarachnoid hemorrhage ( aSAH ) . Epoxyeicosatrienoic acids and dihydroxyeicosatetraenoic acid ( DHET ) cerebrospinal fluid (

<h2 style="margin: 0">4</h2>

<div class="entities" style="line-height: 2.5; direction: ltr">
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P10828
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 mutants : Dominant negative regulators of peroxisome proliferator-activated receptor gamma action . Thyroid hormone ( 
<mark class="entity" style="background: linear-gradient(90deg, #CC9966, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    DB00279
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">MEN</span>
</mark>
 ) and peroxisome proliferators have overlapping metabolic effects in the maintenance of lipid homeostasis . Their actions are mediated by their respective receptors : thyroid hormone receptors ( TR ) and peroxisome proliferator-activated receptors ( 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    Q07869
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 ) . We recently found that a dominantly negative TRbeta mutant ( PV ) that causes a genetic disease , resistance to thyroid hormone , acts to repress the ligand ( troglitazone ) - mediated transcriptional activity of PPARgamma in cultured thyroid cells . This finding suggests that TRbeta mutants could crosstalk with PPARgamma-signaling pathways . The present study explored the molecular mechanisms by which PV represses the PPARgamma transcriptional activity . Gel-shift assays show that the PV , similar to wild-type TRbeta , bound to the peroxisome proliferator response element ( PPRE ) as homodimers and heterodimers with PPARgamma or the retinoid X receptor ( RXR ) , thereby competing with PPARgamma for binding to PPRE and for sequestering RXR . Association of PPRE-bound PV with corepressors [ e . g . , nuclear receptor corepressor ( NCoR ) ] that led to transcriptional repression was independent of 
<mark class="entity" style="background: linear-gradient(90deg, #CC9966, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    DB00279
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">MEN</span>
</mark>
 and troglitazone . Chromatin immunoprecipitation assay further demonstrated that , despite the presence of ligands , NCoR was recruited to PPRE-bound PV on a PPARgamma-target gene , the lipoprotein lipase , in vivo , suggesting the dominant action of PV on PPARgamma-mediated transcriptional activity . Thus , the dominant negative action of PV is not limited on the wild-type TRs . The findings that TRbeta mutants affect PPARgamma functions through dominant negative action provide insights into the molecular mechanisms by which TR regulates the PPARgamma-target genes involved in metabolic pathways , lipid homeostasis , and carcinogenesis .</div>

<h2 style="margin: 0">5</h2>

<div class="entities" style="line-height: 2.5; direction: ltr">Acute renal failure from hemoglobinuric and interstitial nephritis secondary to iodine and mefenamic acid . 
<mark class="entity" style="background: linear-gradient(90deg, #003300, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    DB00784
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">SUB</span>
</mark>
 ingestion , usually in excess and over prolonged period is known to produce interstitial nephritis , or less commonly papillary necrosis , with acute renal failure . However , it is not dose-dependent for the induction of tubulointerstitial damage . Excess iodine ingestion is known to produce toxicity and possible death , but acute renal failure is rare . There is evidence from clinical and experimental data that iodine has toxic effect on tubular epithelial cells . Iodine has not been documented to produce red cell hemolysis and hemoglobinuria . We present a unique case of acute renal failure from hemoglobinuric and acute interstitial nephritis secondary to suicidal ingestion of potassium iodide solution and also ingestion of a few mefenamic acid tablets . These agents led to potentiation of the renal injury from hemoglobinuric tubulopathy , probably from the iodine , and renal dysfunction from alteration of renal perfusion by selective 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P23219
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 inhibition of prostaglandin production , and induction of acute interstitial nephritis from mefenamic acid , leading to acute renal failure which was reversible by hemodialysis and supportive therapy .</div>

<h2 style="margin: 0">6</h2>

<div class="entities" style="line-height: 2.5; direction: ltr">Oxidative stress and DNA hypermethylation status in renal cell carcinoma arising in patients on dialysis . Renal cell carcinoma ( RCC ) is more frequently observed in patients on dialysis than in patients with normal renal function . However , the mechanism underlying carcinogenesis in RCC patients on dialysis is still unclear . We hypothesized that oxidative stress affects patients on dialysis and generates new neoplasms , and therefore analysed the correlation between the influences of various markers of oxidative stress and carcinogenesis in those patients . We evaluated the immunohistochemical expression of oxidative stress markers , such as
